import React from "react";
import "./style.css";
import CarouselM from "../Carousel";

function Jumbotron() {
  return (
    <div className="container-fluid ">
        <div className="jumbotron jumbotron-fluid">
        <div className="container">
            <CarouselM/>
        </div>
        </div>
    </div>
  );
}

export default Jumbotron;
